import React from 'react';
import './possibility.css';
import possibilityImage from '../../assets/possibility.png';
const Possibility = () => {
  return (
    <div className='gpt3__possibility' id="possibility">
      <div className='gpt3__possibility-image'>
        <img src={possibilityImage} alt='possibility' />
      </div>
      <div className='gpt3__possibility-content'>
        <h1 className='gradient__text'>Other Interests</h1>
        <p>I am very passionate and interested when it comes to teaching. I love to see the realisation in people's eyes when I help connect the dots with something they don't understand. Part of the reason why I chose to be a Teaching Assistant during my senior year in undergrad.</p>
        <h4>Teaching Assistant, Amrita School of Engineering</h4>
        <p>I taught Computational thinking and Problem Solving course to the freshman students. I received appreciation for the way I taught and being able to manage <b>2</b> classes of strength <b>60+</b>.</p>
        <h4>CS Outreach Tutor</h4>
        <p>I've carried on that same interest into my mast</p>
      </div>
    </div>
  )
}

export default Possibility
